() => {
  let cycleOptions = [];
  const date = new Date();
  const CurrentYear = date.getFullYear();
  [CurrentYear - 2, CurrentYear - 1, CurrentYear].map(year => {
    cycleOptions.push({
      label: `Oct ${year}`,
      value: `oct${year}`
    }, {
      label: `Jun ${year}`,
      value: `jun${year}`
    });
  });
  return cycleOptions;
}

